import React from "react";
import { Box, Center, Wrap, WrapItem } from "@chakra-ui/react";

export const Nav: React.FC = () => {
  return (
    <Box pos={"absolute"} w={"100%"} bg={"gray.50"} padding={"12px"}>
      <Wrap>
        <WrapItem>
          <Center
            bg="gray.300"
            fontSize={"12px"}
            fontWeight={"bold"}
            rounded={"50px"}
          >
            bberkass
          </Center>
        </WrapItem>
      </Wrap>
    </Box>
  );
};
